package runningTime;

import java.util.ArrayList;
import java.util.HashMap;

// linear time O(n) time, because we have to check each character once
public class RuntimePractice {
    public static int findNumberOfRepetitions(String s, char c) {
        int sum = 0;
        for (int i = 0; i < s.length(); i++) {  //1, n+1, n
            if (s.charAt(i) == c) { //n
                sum++; //n
            }
        }
        return sum; //1 time
    }

    public static int[] findNumberOfRepetitionsv1(String s, char[] c) {
        //Quadratic time O(n*m) times
        int[] sums = new int[c.length]; // 1 time
        for (int i = 0; i < s.length(); i++) { //1, n+1, n
            for (int j = 0; j < c.length; j++) { //n, n*m+1,n*m
                if (s.charAt(i) == c[j]) { //n*m
                    sums[j] = sums[j] + 1; //n*m
                }
            }
        }
        return sums; //1 time
    }

    public static int[] findNumberOfRepetitionsv2(String s, char[] c) {
        // Time: 0(n+m)
        int[] sums = new int[c.length]; // 1 time
        HashMap<Character, Integer> map = new HashMap<>();
        for (int i = 0; i < s.length(); i++) {
            if (!map.containsKey(s.charAt(i))) {
                map.put(s.charAt(i), 1);
            } else {
                int sum = map.get(s.charAt(i));
                map.put(s.charAt(i), sum + 1);
            }
        }
        for (int j = 0; j < c.length; j++) {
            int sum;
            if (!map.containsKey(c[j])) {
                sums[j] = 0;
            } else {
                sums[j] = map.get(c[j]);
            }
        }
        return sums;
    }


    public static void main(String[] args) {
        String input = "";
        char[] a = {'a', 'o'};

        long startTime = System.currentTimeMillis();
        System.out.println(startTime);
        System.out.println(findNumberOfRepetitions(input, 'o'));
        long endTime = System.currentTimeMillis();
        System.out.println(endTime);
        long duration = endTime - startTime;
        System.out.println("Test " + duration + " ms");


        startTime = System.currentTimeMillis();
        System.out.println(startTime);
        findNumberOfRepetitionsv1(input, a);
        endTime = System.currentTimeMillis();
        System.out.println(endTime);
        duration = endTime - startTime;
        System.out.println("Test " + duration + " ms");

        startTime = System.currentTimeMillis();
        System.out.println(startTime);
        findNumberOfRepetitionsv2(input, a);
        endTime = System.currentTimeMillis();
        System.out.println(endTime);
        duration = endTime - startTime;
        System.out.println("Test " + duration + " ms");
    }


}
